# Se importan las libreras necesarias
import matplotlib.pyplot as plt
import numpy as np


# Condiciones iniciales
def Initialize(T_m_initial,T_o_initial, Ccf , T_A):

  ValuesT_m = [T_m_initial]
  ValuesT_o = [T_o_initial]

  return ValuesT_m, ValuesT_o, Ccf, T_A

# Funcin que va actualizando los valores cuando calienta o cuando enfria
def updateHeat(T_m, T_o, Ccf,T_A):

    T_m_new = T_m + Ccf * (T_A - T_m)
    T_o_new = T_o + Ccf * (T_A - T_o)

    return T_m_new, T_o_new

# Funcin que va actualizando los valores de las ecuaciones
def updateCool(T_m, T_o):

    T_m_new = T_m + 0.01 * (2 - T_m)
    T_o_new = T_o + 0.2 * (1- T_o)

    return T_m_new, T_o_new


# Obteniendo los valores
ValuesT_m, ValuesT_o, Ccf, T_A = Initialize(2,1,0.1,22)
Time=[0]

# Realizando la simulacin para calentamiento y enfriamiento
for i in range(1,5000):
  T_m_new, T_o_new = updateHeat(ValuesT_m[-1],ValuesT_o[-1],Ccf,T_A)
  ValuesT_m.append(T_m_new)
  ValuesT_o.append(T_o_new)
  Time.append(i)

ValuesT_mW, ValuesT_oW, CcfW, T_AW = Initialize(2,1,0.001,22)
Time=[0]

# Calentamiento
for i in range(1,5000):
  T_m_newW, T_o_newW = updateHeat(ValuesT_mW[-1],ValuesT_oW[-1],CcfW,T_AW)
  ValuesT_mW.append(T_m_newW)
  ValuesT_oW.append(T_o_newW)
  Time.append(i)


# Realizando la grfica
time_axis = Time
plt.figure(1,figsize=(10, 6))
plt.plot(time_axis, ValuesT_m, label='Medication Storage Room Worst Case k=0.1')
plt.plot(time_axis, ValuesT_o, label='Organ Bank Worst Case k=0.1')
plt.plot(time_axis, ValuesT_mW, label='Medication Storage Room Best Case k=0.001')
plt.plot(time_axis, ValuesT_oW, label='Organ Bank Best Case k=0.001 ')
plt.axhline(y=22, color='r', linestyle='--', label='Room Temperature')
plt.xlabel('Minutes')
plt.ylabel('Temperature (C)')
plt.title('Temperature Changes in Room Temperature')
plt.legend()
plt.grid()
plt.show()


